script: |
  super -f text -I q12350.spq | sort > q12350.out

inputs:
  - name: q12350.spq
    data: |
      SELECT DISTINCT - 23 AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1 WHERE NOT NULL IS NOT NULL;
  - name: tab1
  - name: tab2

outputs:
  - name: q12350.out
    data: |
      -23
